import React from "react";
import styled from "styled-components";
import GIF from "../assets/Home Video.mp4";

const VideoContainer = styled.div`
    width: 100%;

    video {
        width: 100%;
        height: auto;
    }
`;

const CoverImage = ({ image }) => {
    return (
        <VideoContainer>
            <video src={GIF}/>
        </VideoContainer>
    );
}

export default CoverImage;
